#projectPage {
  overflow-x: hidden;
  background-color: white;
  min-height: 700px;
  color: white;
  .title {
    font-size: 32px;
    display: flex;
    align-items: center;
    color: rgba(100, 100, 100, 1);
    font-weight: bold;
    img {
      margin-left: 1rem;
    }
  }
  .title-m {
    font-size: 16px;
    color: rgba(100, 100, 100, 1);
  }
  .main-img {
    max-height: 630px;
    width: 900px;
    border: 1px solid rgba(100, 100, 100, 1);
    border-radius: 20px;
    .main-border {
      border: none;
      border-bottom: 1px solid rgba(100, 100, 100, 1);
      height: 97%;
      border-radius: 20px 20px 0px 0px;
    }
    .second-border {
      border: none;
      border-bottom: 1px solid rgba(100, 100, 100, 1);
      height: 97%;
      border-radius: 20px 20px 0px 0px;
      padding: 1rem;
      img {
        border-radius: 20px 20px 0px 0px;
        height: 100%;
        width: 100%;
      }
    }
  }
  .background {
    .title {
      font-size: 24px;
      color: rgba(100, 100, 100, 1);
    }
    .content {
      font-size: 20px;
      color: rgba(100, 100, 100, 1);
    }
  }
  .skill {
    margin-top: 2rem;
    .title {
      font-size: 24px;
      color: rgba(100, 100, 100, 1);
    }
    ul {
      color: rgba(100, 100, 100, 1);

      font-size: 20px;
    }
  }
  .otherImg {
    margin: 2rem 0rem;
    border-radius: 20px;
    box-shadow: rgba(100, 100, 111, 0.2) 0px 7px 29px 0px;
    img {
      border-radius: 20px;
      width: 100%;
      height: 100%;
    }
  }
}
